import "./Home.css";

function Home() {
    return (
        <div className="home">
            <div className="home_container">
                <img src="https://firebasestorage.googleapis.com/v0/b/mech-mitra-38a35.appspot.com/o/WhatsApp%20Image%202021-07-18%20at%2014.55.02.jpeg?alt=media&token=23e49751-1788-4090-ac65-b9b96bccc839"
                alt=""
                />
            </div>
            
        </div>
    )
}

export default Home
